import React from "react";
import "./NavBar.css";
import NavBarItem from "./NavBarItem";

const NAVBAR = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const NavBar = () => {
  return (
    <div className="narbar">
      <div className="d-flex justify-content-between text-white">
        <h2>Booking Website</h2>
        <div className="pf-5">
          <button>Regiter</button>
          <button>Login</button>
        </div>
      </div>
      {NAVBAR.map((item, index) => (
        <NavBarItem
          type={item.type}
          icon={item.icon}
          active={item.active}
          key={index}
        />
      ))}
    </div>
  );
};

export default NavBar;
